import React, { useState, useEffect } from 'react';

type Coordinate = {
    x: number;
    y: number;
  };

  // JSON データ全体を表す型
  type ImageData = {
    image1: string;
    image2: string;
    location: Coordinate;
    direction0: Coordinate;
    direction1: Coordinate;
    direction2: Coordinate;
    direction3: Coordinate;
  };
  const fetchData = async (): Promise<ImageData> => {
    const response = await fetch('pseuddata.json');
    const data: ImageData = await response.json();
    return data;
  };

  const displayData = async () => {
    try {
      const data = await fetchData();
      console.log(data.image1, data.image2);
      console.log(data.location, data.direction0, data.direction1, data.direction2, data.direction3);
    } catch (error) {
      console.error('Error fetching or processing data:', error);
    }
  };

  displayData();
